INSERT INTO `cs_notice` VALUES (1,87,1,0,1,'[공지] 게임머니 불법거래 근절 캠페인 안내','<p>안녕하세요! 포커레전드<span style=\"text-align: unset;\">입니다.</span></p><p><br></p><p><span style=\"text-align: unset;\">포커레전드</span>은 건전한 게임 환경 조성과 불법거래 근절을 위해 항상 노력하고 있습니다.</p><p><span style=\"text-align: unset;\">개인 간의 게임머니 현금거래(양도, 매매)를 하는 것은 불법이며, 게임산업 진흥에 관한 법률에 의거하여, 금지됩니다.&nbsp;</span><br></p><p><span style=\"text-align: unset;\">게임머니 현금거래 내용 적발 시 게임 계정 이용제한 및 게임머니 삭제 조치가 이루어질 수 있으며, 조치된 게임 계정은 번복 처리되지 않습니다.&nbsp;</span><br></p><p><br></p><p>[게임머니 불법거래 및 광고 신고 방법]</p><p><span style=\"text-align: unset;\">게임이용자보호센터 불법게임물신고</span></p><p><span style=\"text-align: unset;\">(http://www.gucc.or.kr)</span><br></p><p><br></p><p>항상 최고의 서비스를 위해 노력하는 포커레전드이 되겠습니다.</p><p><span style=\"text-align: unset;\">감사합니다.</span><br></p>','all',16,'조지훈','2022-02-24 19:51:10','2032-12-31 19:53:37','2022-02-24 19:50:07','2024-08-29 01:59:06',0),(2,2,0,0,1,'[안내] 슈퍼윈 포커 오픈 안내','<p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed;\"><span style=\"font-size: 10pt; font-family: &quot;맑은 고딕&quot;;\">안녕하세요</span><span style=\"font-size: 10pt; font-family: &quot;맑은 고딕&quot;;\">.</span></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed;\">즐거운 한판 승부사 슈퍼윈 포커입니다.</p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed;\"><br></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed;\"></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed;\"><span style=\"font-size: 10pt; font-family: &quot;맑은 고딕&quot;;\">인기\n게임을 한번에 즐길 수 있는 정통 소셜 카지노 </span><span style=\"font-size: 10pt; font-family: &quot;맑은 고딕&quot;;\">슈퍼윈</span><span style=\"font-size: 10pt; font-family: &quot;맑은 고딕&quot;;\">\n포커가 오픈</span><span style=\"font-size: 10pt; font-family: &quot;맑은 고딕&quot;;\">했습니다</span><span style=\"f